//import logo from './logo.svg';
import './App.css';

//import Row from './Components/Row';
import GameTable from './Components/GameTable';

function App() {

  const games = [{title: "Game 1", Genre: "Action", releaseDate: "2023-01-01", hltb: "10h", timePlayed: "5h", playedStatus: "In Progress", score: "8"}]
  return (
    <div className="app">
      <h1>Game List</h1>
      <GameTable games={games} /> 
    </div>
  );
}

export default App;
